(193, 64, '', 'Green Wall supply and supervision', '1,7,11,64,83', '2,4,5,6,9,18,19,22,25,55,66', 2, '6 months after contract approval', '5 years on system', 'As per below', '3 months', '2018/Qatar/GW326.2/NCE', '', 'Dear Sirs,\n\nThank you for approaching GreenStudios.\n\nPlease find below our preliminary site requirements, and budget proposal for your kind review. \n', 'Should you find our offer satisfactory, you are kindly requested to return the copy of the offer attached duly signed at the below address or to by email to hello@greenstudios.net\n\nliability notes:\n- GreenStudios or any assigned installer, are not responsbile for any damages or delays coming  from water , artificial lights (if needed) or electricity interruptions/cuts.', 'In case of LC, Bank fees to be charged separately ', '- Expected number of supervision visits:\nVisit #1: Site inspection before installation + plant nurseries survey and plant selection + coordination with all disciplines for all preparation works before site kick off (duration 3 days)\nVisit #2: Installation kick off + final plants order (duration 10 days)\nVisit #3: Hydroponic skin fixation and water testing (duration 10 days)\nVisit #4: Plantation and maintenance training (duration 5 days) \n\n- Expected local landscape team required for execution:\n2 Foremen + 10 laborers (total duration of works: 30 days)\n\n- A list of tools is attached for the local landscape contractor to procure (in case needed GreenStudios can procure and ship the needed tools for the installation)', 0, 5361, 1, 0, 0, 1629, 'NCE', 1, 0, '50% upon offer approval and minimum 6 months before expected shipment of material from Beirut to Qatar\n40% once GreenStudios confirms by email that all merchandise have been produced & ready to be shipped to Qatar\n10% once system is installed, water testing is done and before plantation', 0, 0, '');
