(180, 9060, 'ZinCo Fallnet SR Rail Base Unit 3', 'PCE       ', 920, 5, 'horizontally gliding fixing device', '39259010', '1 start grid element and 1 end grid element, each area ca. 2 x 2 m, consisting of 4 grid segments, made of recycled polyethylene, height ca. 30 mm, two rail supports made of stainless steel with base plate for fixing rail profile, height ca. 200 mm, , fixing rail made of high quality aluminium alloy, rail length ca. 3 m, incl. 2 stoppers, 2 connectors, fixing material and a horizontally gliding runner with fixing eye, Including Installation and Instruction Manual and Inspection Chart, stabilizing ballast to be provided by the customer. \nPlease note: ZinCo Fallnet is a fixing device for fall protection on flat roofs for one person (up to 100 kg) in combination with personal protection equipment (as e.g. ZinCo Fallnet PPE set). ZinCo Fallnet is tested according to European Standard EN 795, Class E. Please be informed that - irrespective of the product liability  ZinCo does only bear the consultancy liability provided that the installation is carried out according to our planning. Installation without ZinCo planning is on your own risk. The mounting guidelines as well as the instruction manual handed out with the products have to be strictly observed anyway.', b'1', 178, 0, 0, 0, '', 0, 0),
