(265, 0, 'Plastic expansion concrete anchor with shoulders', 'NB', 0, 1, 'dimensions length: 5cm, diameter: 8 mm for 6 mm screw and 6 mm for 5 mm screw ', '83024100', 'Used to fix screws in concrete, brick, mortar or wood. The combination of the stainless steel 304 screw 5x50 mm and the plastic expansion anchor 6x30 mm has a pull out strength (tensile strength) of min. 250 Kg and a shear strength of min. 500 Kg. ', b'1', 329, 0, 0, 0, '', 0, 0),
(266, 0, 'Plastic hollow wall anchor ', 'NB', 0, 1, 'dimensions length: 5cm, anchor diameter: 8 mm, drilling hole: 8 mm', '83024100', 'Used to fix omegas to a concrete wall made of hollow blocks. Length and grip range depend on wall thickess and dimensions. ', b'1', 330, 0, 0, 0, '', 0, 0),
(267, 0, 'Galvanized concrete screws', 'NB', 0, 1, 'dimensions length 3.2 cm, diameter: 4.8-6 mm', '33310', 'Used to fix omega bars on the primary structure when made of reinforced concrete or hollow blocks walls. Plastic anchors must be used with it. Drill upward and fill the hole with water cut off paste if exposed to humidity. Better to be used indoor. ', b'1', 331, 0, 0, 0, '', 0, 0),
(268, 0, 'Zinc plated wood screws', 'NB', 0, 1, 'dimensions length 5 cm, diameter: 6 mm', '', 'Screw made of zinc-plated steel and used to fix the omega bars on a wood primary structure. ', b'1', 332, 0, 0, 0, '', 0, 0),
(269, 0, 'Hot dip galvanized self drilling sheet metal screw                               ', 'NB', 0, 1, 'dimensions length 3.2 cm, diameter: 4.8 - 6 mm', '', 'Hot dip galvanized steel screw used to fix the omega bars on a steel structure. It is self drilling, rust resistant and for outdoor use where not exposed to salts.', b'1', 333, 0, 0, 0, '', 0, 0),
(270, 0, 'Hot dip galvanized or SS 304 sleeve type hollow wall anchors or Molly bolts     ', 'NB', 0, 1, 'dimensions length 5 cm, diameter: 6 mm, anchor diameter: 12 mm, drilling hole: 13 mm', '', 'Made to fix omega bars in outdoor humid conditions to concrete walls made of hollow blocks (for a better fastening than plastic hollow wall anchors). The length of anchor and grip range depend on block thickness and dimensions. It also can be made of stainless steel for better corrosion resistance. ', b'1', 334, 0, 0, 0, '', 0, 0),
(271, 0, 'Sealant - Adhesive paste tube', 'NB', 0, 1, 'Tube of 300 ml, density:1.5, tensile strength:1.5 Mpa, Permanent flexibility:20%, service temperature: -40C to +70C, color black, white, grey, brown and clear.', '6807190', 'Made of solvant free combination of high quality silicone and polyurethane (PU). Used as water cut off for screws holes in the wall and to waterproof any small holes and can be used to seal and stick any surfaces together. Resistant to chemicals, acids and petrol. Quick curing and overpaintable. Resistant to extreme temperatures from -40 to + 150C.', b'1', 335, 0, 0, 0, '', 0, 0),
(272, 0, 'Stainless steel Omega shaped secondary structure ', 'NB', 0, 1, 'dimensions ca. 3cm deep x 200 cm', '7061190', '0.8 mm thick SS 304 grade, 3cm deep, 2m Height, fixed using galvanized or Stainless Steel 304 screws (5 to 6 mm) when outdoor at 30 cm spacing with plastic anchors, on primary structure,  drilled with upward inclination and sealed with water cut-off and spaced at a maximum of 61cm center to center ', b'1', 336, 0, 0, 0, '', 0, 0),
(273, 0, 'Galvanized Omega shaped secondary structure ', 'NB', 0, 1, 'dimensions Length: 2 m, Depth: 3cm, Thickness: 1 mm', '7061190', '1 mm thick galvanized steel, 3cm deep, 2m Height, fixed using galvanized or Stainless Steel 304 screws (5 to 6 mm) when outdoor at 30 cm spacing with plastic anchors, on primary structure,  drilled with upward inclination and sealed with water cut-off and spaced at a maximum of 61cm center to center ', b'1', 337, 0, 0, 0, '', 0, 0),
(274, 0, 'Stainless steel 316 sheet metal screw', 'NB', 0, 1, 'dimensions length; 32mm, diameter: 4.8-6 mm', '', 'stainless Steel 304 screw, used to fix omega bars to steel structures. Used for humid outdoor conditions and sea side areas.', b'1', 338, 0, 0, 0, '', 0, 0),
(275, 0, 'Stainless steel 316 concrete screw ', 'NB', 0, 1, 'dimensions length; 50mm, diameter: 5-6 mm', '', 'Screw made of stainless steel 304, used to fix omega bars to reinforced concrete wall and hollow blocks wall in humid conditions and seaside areas. 6 to 8 mm plastic anchors must be used with it. Combined with 6x30 mm expansion anchor, it has a pull out strength of min. 200 Kg and a min. sheer strength of 450 Kg.   ', b'1', 339, 0, 0, 0, '', 0, 0),
(276, 0, 'Hot dip galvanized roll bolt                                     ', 'NB', 0, 1, 'dimensions length: 50-55 mm, Diameter: 6-8 mm', '6807190', 'Used in cases where primary structure is a hollow brick wall or in cases  where green wall dead load is high due to heavy tree planting.', b'1', 340, 0, 0, 0, '', 0, 0),
(277, 0, 'PVC free foam waterproofing board', 'NB', 0, 1, 'dimensions length: 122 cm x width: 244 cm, weight: 20 Kg, thickness: 12mm, area= 3 m2', '39211290', '12mm thick, PVC waterproofing panels, fixed  to secondary structure using closed end blind rivets (25mm length, 4.8mm thickness) made of aluminum. Joints are protected  with waterproofing bitumen tape of 10 cm width. Aluminum blind rivets are resistant to the corrosive nature of enriched water.  ', b'1', 341, 0, 0, 0, '', 0, 0),
(278, 0, 'Closed end waterproof blind rivets Alu/Alu', 'NB', 0, 1, 'dimensions length: 25mm, rivet/mandrel thickness: 4.8mm', '', 'Rivets are used to fix the waterproofing board onto the omega bars surface or to a steel srtucture. It gives better fastening than self drilling screws and it is all made of aluminum because always in contact with the corrosive irrigation water. It will not rust and there is no need to protect it with a waterproofing tape. The rivets are 100% waterproof when inserted in the waterproofing boards. It has a large dome head rivet for better waterproofing. These rivets have a pull out strength (tensile strength) of 128 Kg/rivet and a shear strength of 112 Kg/rivet.', b'1', 342, 0, 0, 0, '', 0, 0),
(279, 0, 'Self adhesive rubber modified bituminous waterproofing tape', 'NB', 0, 1, 'dimensions 5 cm width, 10 m length', '68071090', 'Self adhesive tape reinforced with a polyester film, used to seal the junction between the waterproofing boards and waterproof it strongly. It waterproofs also the junction between the waterproofing board and jambs or any other junctions.', b'1', 343, 0, 0, 0, '', 0, 0),
(280, 0, 'Self adhesive rubber modified bituminous waterproofing tape', 'NB', 0, 1, 'dimensions 10 cm width, 10 m length', '68071090', 'Self adhesive tape reinforced with a polyester film, used to seal the junction between the waterproofing boards and waterproof it strongly. It waterproofs also the junction between the waterproofing board and jambs or any other junctions.', b'1', 344, 0, 0, 0, '', 0, 0),
(281, 0, 'Self adhesive rubber modified bituminous waterproofing tape', 'NB', 0, 1, 'dimensions  15 cm width, 10 m length', '68071090', 'Self adhesive tape reinforced with a polyester film, used to seal the junction between the waterproofing boards and waterproof it strongly. It waterproofs also the junction between the waterproofing board and jambs or any other junctions.', b'1', 345, 0, 0, 0, '', 0, 0),
(282, 0, 'PVC liner', 'M2', 0, 1, 'thickness: 1 to 2 mm', '', 'Waterproof geomembrance made of poly vinyl chloride (PVC). It is chemical resistant and root resistant. It is not UV resistant and must be covered. Used to cover and waterproof large linear and deep gaps to avoid using thin pieces of PVC. It offers more flexibility and shapes in corners and non homogeneous surfaces. ', b'1', 346, 0, 0, 0, '', 0, 0),
(283, 0, 'Aluminum 90 ''L'' shaped corner + SS 304 screws', 'NB', 0, 1, 'dimensions: length: 5 cm, width: 3 cm, thikness: 2.5 mm', '', 'Aluminum ''L'' shaped, perforated with 1 perforation of 6 mm for each side, fixed with stainless steel 304 screws (2.5 cm x 4.5 mm), used to fix PVC corners to the waterproofing boards where large gaps have to be covered and waterproofed later by bituminous tape. Spacing between 2 pieces of Aluminum is 30 cm minimum', b'1', 347, 0, 0, 0, '', 0, 0),
(284, 0, 'PU foam spray', 'NB', 0, 1, 'Spray can of 300 ml', '', 'This PU foam is used to fill waterproofing bord large size gaps and waterproof them. Recommended to add above it a waterproof tape or liner. Useful when used behind the waterproofing boards as support to prevent cracks from expanding.', b'1', 348, 0, 0, 0, '', 0, 0),
(285, 0, 'Galvanized steel sleeve tube with galvanized clamps x 2 + 1 coupling + 1 elbow for each 3m of pipe       ', 'M', 0, 3, 'dimensions: length: upon request, tube diameter: 1/2", 3/4" or 1" depending on needed number of cables', '', 'Used to protect electrical wires such as CAT 5 cables from any impact or stapling when it is not in contact with corrosive irrigation water. Recommended to be fixed behind the waterproofing boards. Couplings, elbows and clamps  are also available in this kit.', b'1', 349, 0, 0, 0, '', 0, 0),
(286, 0, 'Stainless steel 304 sleeve tube with stainless steel 304 clamps + 1 coupling + 1 elbow for every 2 m of pipe                 ', 'M', 0, 3, 'dimensions: length: upon request, tube diameter: 1/2", 3/4" or 1" depending on needed number of cables', '', 'Used to protect electrical wires such as CAT 5 cables from any impact  or stapling when it is in contact with corrosive irrigation water. Can be fixed on the waterproofing boards and under the skin. Couplings, elbows and clamps are also available in this kit.', b'1', 350, 0, 0, 0, '', 0, 0),
(287, 0, 'Multi layered hydroponic skin, type 0', 'MTK       ', 0, 1, 'dimensions ca. 63 cm width, 185 cm length (before stapling)', '56021090', 'Multi-layered hydroponic patented skin, type 0, for indoor environment, fixed onto waterproofing boards using air pressured stapling ', b'1', 351, 0, 0, 0, '', 0, 0),
(288, 0, 'Multi layered hydroponic skin, type 0', 'MTK       ', 0, 1, 'dimensions ca. 31.5 cm width, 185 cm length (before stapling)', '56021090', 'Multi-layered hydroponic patented skin, type 0, for indoor environment, fixed onto waterproofing boards using air pressured stapling ', b'1', 352, 0, 0, 0, '', 0, 0),
(289, 0, 'Multi layered hydroponic skin, type 1', 'MTK       ', 0, 1, 'dimensions ca. 63 cm width, 185 cm length (before stapling)', '56021090', 'Multi-layered hydroponic patented skin, type 1, for cold and humid environment, fixed onto waterproofing boards using air pressured stapling', b'1', 353, 0, 0, 0, '', 0, 0),
(290, 0, 'Multi layered hydroponic skin, type 1', 'MTK       ', 0, 1, 'dimensions ca. 31.5 cm width, 185 cm length (before stapling)', '56021090', 'Multi-layered hydroponic patented skin, type 1, for cold and humid environment, fixed onto waterproofing boards using air pressured stapling ', b'1', 354, 0, 0, 0, '', 0, 0),
