(292, 0, 'Multi layered hydroponic skin, type 2', 'MTK       ', 0, 1, 'dimensions ca. 31.5 cm width, 185 cm length (before stapling)', '56021090', 'Multi-layered hydroponic patented skin, type 2, for mediteranean and subtropical environment, fixed onto waterproofing boards using air pressured stapling ', b'1', 356, 0, 0, 0, '', 0, 0),
(293, 0, 'Multi layered hydroponic skin, type 3', 'MTK       ', 0, 1, 'dimensions ca. 63 cm width, 185 cm length (before stapling)', '56021090', 'Multi-layered hydroponic patented skin, type 3, for extremely hot environments, fixed onto waterproofing boards using air pressured stapling', b'1', 357, 0, 0, 0, '', 0, 0),
(294, 0, 'Multi layered hydroponic skin, type 3', 'MTK       ', 0, 1, 'dimensions ca. 31.5 cm width, 185 cm length (before stapling)', '56021090', 'Multi-layered hydroponic patented skin, type 3, for extremely hot environments, fixed onto waterproofing boards using air pressured stapling', b'1', 358, 0, 0, 0, '', 0, 0),
(295, 0, 'Multi layered hydroponic skin, type 4', 'MTK       ', 0, 1, 'dimensions ca. 63 cm width, 185 cm length (before stapling)', '56021090', 'Multi-layered hydroponic patented skin, type 4, for trees and big shrubs, fixed onto waterproofing boards using air pressured stapling. An additional suport layer on top of watreproofing boards might be needed to bear the moment of larger plants speciments for this type. ', b'1', 359, 0, 0, 0, '', 0, 0),
(296, 0, 'Multi layered hydroponic skin, type 4', 'MTK       ', 0, 1, 'dimensions ca. 31.5 cm width, 185 cm length (before stapling)', '56021090', 'Multi-layered hydroponic patented skin, type 4, for trees and big shrubs, fixed onto waterproofing boards using air pressured stapling. An additional suport layer on top of watreproofing boards might be needed to bear the moment of larger plants speciments for this type. ', b'1', 360, 0, 0, 0, '', 0, 0),
(297, 0, 'Fiber mat UV resistant', 'NB', 0, 1, 'dimensions: width: 30 x length: 200 cm', '56021090', 'Made of UV resistant needled fleece mat, biologically neutral, resistant to chemicals occurring in substrates, 100% polyester, 5 mm thick, tensile strength length wise > 9 KN/m  or 917.74 Kgf/m, tensile strength cross wise > 19 KN/m, break point after stretch 10-16%, loss of strength by humidity = 0%, penetration force > 2000 N, class strength = 3, dry weight = 470 g/m2, water retention = 0.9 L/m2, color: light grey; used to cover irrigation pipes and conducts on wall. ', b'1', 361, 0, 0, 0, '', 0, 0),
(298, 0, 'Stainless steel 304 staples', 'NB', 0, 1, 'dimensions: length: 38 mm, thickness 1.4 mm, crown width 10 mm, in boxes of 10000 staples', '6807190', 'High quality Stainless Steel 304 Staples,3.8 cm length; used to fix the multi layered hydropnic skin to the waterproofing boards.', b'1', 362, 0, 0, 0, '', 0, 0),
(299, 0, 'Stainless steel 304 staples', 'NB', 0, 1, 'dimensions: length: 30 mm, thickness 1.02 mm, crown width 8.8 mm, in boxes of 2500 staples', '6807190', 'Stainless Steel 304 Staples, 3 cm length; used to fix the multi layered hydropnic skin to the waterproofing boards.', b'1', 363, 0, 0, 0, '', 0, 0),
(300, 0, 'PE pipe not perforated PN4 and PN6 - black with line', 'M', 0, 2, 'dimensions ca. 40 mm', '39173990', 'PE Irrigation Pipe fixed on waterproofing boards behind the skin ', b'1', 364, 0, 0, 0, '', 0, 0),
(301, 0, 'PE pipe not perforated PN4 and PN6 - black with line', 'M', 0, 2, 'dimensions ca. 32 mm', '39173990', 'PE Irrigation Pipe fixed on waterproofing boards behind the skin ', b'1', 365, 0, 0, 0, '', 0, 0),
(302, 0, 'PE pipe not perforated PN4 and PN6 - black with line', 'M', 0, 2, 'dimensions ca. 25 mm', '39173990', 'PE Irrigation Pipe fixed on waterproofing boards behind the skin ', b'1', 366, 0, 0, 0, '', 0, 0),
(303, 0, 'PE irrigation pipe', 'M', 0, 5, 'dimensions ca. 16 mm', '39173990', 'PE Irrigation Pipe with in line drippers for irrigation of green roof', b'1', 367, 0, 0, 0, '', 0, 0),
(304, 0, 'Flexible PVC microtube - black', 'M', 0, 1, 'dimensions: ca. 4 to 6 mm', '39173990', 'Flexible mini pipes are used on the GW to irrigate corners or inaccessible areas by the main line on the wall. It must not be longer than 1.2 m to avoid a sudden drop in pressure.', b'1', 368, 0, 0, 0, '', 0, 0),
(305, 0, 'Microtubes connectors', 'M', 0, 1, 'dimensions: ca. 4 to 6 mm', '39173990', 'Used to connect the mirotubes to the main line or to connect microtubes to each others (couplings).', b'1', 369, 0, 0, 0, '', 0, 0),
(306, 0, 'Pressure compensating emitters', 'NB', 0, 2, 'dimensions: operating pressure: 1 to 3.5 bars, operating flow: 2 gph', '', 'Fixed online on the irrigation pipe (self piercing) (ex: Rainbird xeribug emitters).', b'1', 370, 0, 0, 0, '', 0, 0),
(307, 0, 'Pressure compensating emitters', 'NB', 0, 2, 'dimensions: operating pressure: 1 to 3.5 bars, operating flow: 5 gph', '', 'Fixed online on the irrigation pipe (self piercing) (ex: Rainbird xeribug emitters).', b'1', 371, 0, 0, 0, '', 0, 0),
(308, 0, 'Pressure compensating emitters', 'NB', 0, 2, 'dimensions: operating pressure: 1 to 3.5 bars, operating flow: 7 gph', '', 'Fixed online on the irrigation pipe (self piercing) (ex: Rainbird xeribug emitters).', b'1', 372, 0, 0, 0, '', 0, 0),
