(476, 'LK: architect saw colonnel and contacted us. Project is in construction now and will be ready for green wall installation in about 10 months.', '2018-07-13', 2, 643, 476, 0),
(477, 'project is still in design phase and budget was out of range (ref. email 05/07/2018)', '2018-07-13', 2, 614, 477, 0),
(478, 'LK: as per Jamili''s email the site is empty so far, construction will start later and will not be ready for sample mockup till after a year probably.', '2018-07-13', 2, 515, 478, 0),
(479, 'LK: Pergola have withdrawn from the project and we have contacted K&A to connect us directly to client', '2018-07-10', 2, 64, 479, 0),
(480, 'LK: offices are being re-worked and expected execution is maximum in 3 months. client wants original plants in the green walls.', '2018-07-23', 2, 652, 480, 0),
(481, 'LK: as per our office meeting, Mr. Yassine confirmed that green wall in the living room will reach the ground and no shelf in it.', '2018-07-25', 2, 547, 481, 0),
(482, 'LK: they will submit the details to their ministry of works department. If they agreed on ZinCo specifications they will contact us soon. ', '2018-07-31', 2, 659, 482, 0),
(483, 'DN: project was canceled because budget is not available for it.', '2018-07-31', 2, 610, 483, 0),
