(485, 'LK: project transfered to Greenway Industries', '2018-08-03', 2, 648, 485, 0),
(486, 'IK: we should meet with Victoria during our next trip to Dubai in September to finalize areas as she is waiting for some approvals. ', '2018-08-09', 2, 475, 486, 0),
(487, 'IK: we should meet with Victoria during our next trip to Dubai in September to finalize areas as she is waiting for some approvals. ', '2018-08-09', 2, 476, 487, 0),
(488, 'IK: client is indecisive. GW will be on one of the walls surrounding a waterfall (width 2.5 m). that leaves 2 strips of green walls (width 2.25 m) from each side of the water feature. Nasser will send us final dimensions in a couple of weeks.', '2018-08-14', 2, 592, 488, 0),
(489, 'Jamil sent offer to client by whatsapp', '2018-08-14', 2, 4, 489, 0),
