(491, 'LK: project on hold', '2018-08-14', 2, 95, 491, 0),
(492, 'LK: called Shane. she said job was awarded to competition and that''s why she didn''t get back to us with more details.', '2018-08-20', 2, 622, 492, 0),
(493, 'LK: landscaping job. no Green roof or walls in it', '2018-08-20', 2, 619, 493, 0),
(494, 'LK: as per DIB, project is on hold for the moment and should get back on line end of September. they will follow up on the lighting and green walls once project is back on track. ', '2018-08-20', 2, 536, 494, 0),
(495, 'Send Maintenance Contract and reminder that 3 months maintenance period is over.', '2018-08-30', 6, 532, 495, 0),
(496, 'most of the green walls propose will come with wire system. however for some walls the wire system will not work and they might need our system.  ', '2018-08-30', 2, 616, 496, 0),
(497, 'Called Eng. Nazih, 0096599265753. He will get back on Monday with a reply from the client. Pro design have finished their work for site supervision and are out of the project currently.', '2018-08-30', 6, 454, 497, 0),
(498, 'client lost the bid for the green walls. ', '2018-09-03', 2, 559, 498, 0),
(499, 'Called Eng. Nazih, Miss Sahar Samad, PM mentioned that the client has cancelled the green wall due to the budget. Pro Design have finished their work and left the project.', '2018-09-03', 1, 454, 499, 0),
(500, 'Called Eng. Abdul Mohsen, mentioned that their was no reply from the ministry related to the project. He believes the project was a recommended solution and they no longer want to proceed with it. They will double check and hopefully get back to us with a definite reply on project status. ', '2018-09-03', 1, 455, 500, 0),
(501, 'Verbal Approval to Aziz. We will get exact areas from PM to submit an offer for the 2 green wall options proposed. ', '2018-09-03', 6, 374, 501, 0),
(502, 'Mr. Khaled Al Othman submitted a financial request for approval for the budget. But the location was lost. Aziz is working on the next location for a green wall according to budget approval from Ministry.', '2018-09-03', 6, 493, 502, 0),
(503, '2 out of 4 villas possibly YES. Saad villa area is chosen and Dhari to be seen on site ', '2018-09-04', 2, 499, 503, 0),
(504, 'called Amr Deghaidy and agreed to: 1. revise old offer 2.prepare supply supervise deal', '2018-09-04', 1, 427, 504, 0),
(505, 'project was slow moving; called akram Najjar and he said we will mention to client/consultant this coming Sunday that we want to meet them end of September and pitch again to revive it ', '2018-09-04', 1, 414, 505, 0),
(506, 'called Louaiy Diwan are the lowest bidders and awaiting to be awarded ; project looks like slow pace ; should meet them while in Kuwait ', '2018-09-04', 1, 392, 506, 0),
