(513, 'LK: sent an email mentioning we are available if they need any additional information and to meet for coordination of water supply outlets and others. no reply. ', '2018-08-28', 2, 483, 513, 0),
(514, 'IK: ishak called Zeina Al Sheikh. she informed him that green wall offer was out of budget and they are not doing any anymore. ', '2018-09-06', 2, 491, 514, 0),
(515, 'LK: Sameer is out of the country. he will call us back sunday or monday (september 10) to give us update after he talks to client', '2018-09-06', 2, 413, 515, 0),
(516, 'IK: progress on site is slow. expected kick off date september 2019. to call back in July', '2018-09-06', 2, 164, 516, 0),
